import './Topo.css'
import { NavLink } from 'react-router-dom'

const MenuTopo = () => {
    return (
        <header className='menu-topo'>
            <NavLink to='/' style={{
                textDecoration: 'none',
                flexWrap: 'wrap',
                justifyContent: 'center'
         }} 
         end>
                <img src='/imagens/Logo-2.png' alt='logo' />
                <h1>Valino Games</h1>
            </NavLink>
        </header>
    )
}

export default MenuTopo
